# Initialize the error log
echo "" > $error_log

# Function to clean up escape characters for jq
clean_escapes() {
  echo "$1" | sed 's/\\"/"/g'
}

# Iterate over each transformation
for transformation in "${GENESIS[@]}"; do
  clean_transformation=$(clean_escapes "$transformation")

  echo "Applying transformation: $clean_transformation"

  # Apply the transformation
  jq "$clean_transformation" "$input_file" > "$temp_file" 2>> $error_log

  # Check if jq succeeded
  if [ $? -ne 0 ]; then
    echo "Error applying transformation: $clean_transformation" >> $error_log
  else
    # If successful, update the input file to the temp file for the next iteration
    cp "$temp_file" "$input_file"
  fi
done

# Print any errors
if [ -s $error_log ]; then
  echo "Errors found:"
  cat $error_log
else
  echo "All transformations applied successfully."
fi

# Clean up
rm -f $temp_file